import React, {Component} from 'react'
import './users.css';


class Users extends Component {  
    constructor(){
        super();
        this.state = {
          users: []
        }
    }

    componentDidMount(){
        fetch('http://localhost:3000/users' , {mode: 'no-cors'})
        .then(res => res.json())
        .then(users => this.setState({users}))
    }

    render (){
        return (
            <div>Users</div>

        );
    }  
}

export default Users;
